import React from "react";
import { Col, Row, Container } from "../../components/Grid";

class Home extends React.Component {
    render() {
        return (
            <Container fluid>
                <Row fluid>
                    <Col size="md-6">
                        <h1>James</h1>
                    </Col>
                    <Col size="md-6">
                        <h1>Kariuki</h1>
                    </Col>
                </Row>
            </Container>
        )
    }


}


export default Home;
